import logo from './logo.svg';
import './App.css';

import React from 'react';
import './App.css'; // Your existing CSS file
import ImageComponent from './ImageComponent'; // Import the new component

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <ImageComponent /> {/* Render your image component here */}
      </header>
    </div>
  );
}

export default App;


